USE UniTrac


SELECT WI.ID [WorkItemId], OC.OUTPUT_TYPE_CD, OC.TYPE_CD, OB.* FROM dbo.OUTPUT_BATCH OB
JOIN dbo.OUTPUT_CONFIGURATION OC ON OC.ID = OB.OUTPUT_CONFIGURATION_ID
join WORK_ITEM WI ON WI.RELATE_ID = OB.PROCESS_LOG_ID AND WI.RELATE_TYPE_CD = 'Osprey.ProcessMgr.ProcessLog'
  WHERE WI.ID IN (42146285 )
 
--Loan Screen Information - LOAN/COLLATERAL/PROPERTY/OWNER/REQUIRED COVERAGE
SELECT i.id INTO #tmp
--INTO UnitracHDStorage..INC0323704
FROM LOAN L
INNER JOIN COLLATERAL C ON L.ID = C.LOAN_ID
INNER JOIN PROPERTY P ON C.PROPERTY_ID = P.ID
INNER JOIN dbo.REQUIRED_COVERAGE RC ON RC.PROPERTY_ID = P.ID
INNER JOIN dbo.LENDER LL ON LL.ID = L.LENDER_ID
INNER JOIN dbo.PROPERTY_OWNER_POLICY_RELATE POP ON POP.PROPERTY_ID = P.ID
INNER JOIN dbo.OWNER_POLICY OP ON OP.ID = POP.OWNER_POLICY_ID
JOIN dbo.POLICY_COVERAGE PC on PC.OWNER_POLICY_ID = OP.ID
JOIN dbo.IMPAIRMENT I ON I.REQUIRED_COVERAGE_ID = RC.ID
WHERE LL.CODE_TX IN ('2845') AND C.Collateral_code_id = 313 AND L.NUMBER_TX NOT IN ('325084795', '30450296')
AND  OP.SPECIAL_HANDLING_XML.value('(/SH/WallsIn)[1]', 'varchar (50)') IS NOT NULL



SELECT * FROM dbo.PROPERTY_CHANGE PC
LEFT JOIN dbo.PROPERTY_CHANGE_UPDATE PCU ON PC.ID = PCU.CHANGE_ID
WHERE Pc.USER_TX = 'jshrum' AND PC.CREATE_DT >= '2017-10-27 10:00'


SELECT * FROM dbo.IMPAIRMENT
WHERE REQUIRED_COVERAGE_ID IN (193212666,
193212665)


